import React, { Component } from "react";
import SearchBar from "../components/SearchBar";
import CartIcon from "../components/CartIcon";

class Mainpage extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div>
        <SearchBar />
        <CartIcon />
      </div>
    );
  }
}

export default Mainpage;
